"vs/workbench/parts/terminal/electron-browser/terminal.contribution":["Alle geöffneten Terminals anzeigen","Terminal","Integriertes Terminal","Der Pfad der Shell, den das Terminal unter Linux verwendet.","Die Befehlszeilenargumente, die für das Linux-Terminal verwendet werden sollen.","Der Pfad der Shell, den das Terminal unter OS X verwendet.","Die Befehlszeilenargumente, die für das OS X-Terminal verwendet werden sollen.","Der Pfad der Shell, den das Terminal unter Windows verwendet, wenn in Windows enthaltene Terminals verwendet werden  (cmd, PowerShell oder Bash unter Ubuntu).","Die Befehlszeilenargumente, die im Windows-Terminal verwendet werden sollen.","Wenn dies festgelegt ist, erscheint das Kontextmenü bei einem Rechtsklick im Terminal nicht mehr. Stattdessen erfolgen die Vorgänge Kopieren, wenn eine Auswahl vorgenommen wurde, sowie Einfügen, wenn keine Auswahl vorgenommen wurde.",'Steuert die Schriftartfamilie des Terminals. Der Standardwert ist "editor.fontFamily".',"Steuert den Schriftgrad des Terminals in Pixeln.","Steuert die Zeilenhöhe für das Terminal. Dieser Wert wird mit dem Schriftgrad des Terminals multipliziert, um die tatsächliche Zeilenhöhe in Pixeln zu erhalten.","Gibt an, ob Fettdruck im Terminal aktiviert wird. Dies muss durch die Terminalshell unterstützt werden.","Steuert, ob der Terminalcursor blinkt.","Steuert den Stil des Terminalcursors.","Steuert die maximale Anzahl von Zeilen, die das Terminal im Puffer beibehält.","Steuert, ob Gebietsschemavariablen beim Start des Terminals festgelegt werden. Der Standardwert ist unter OS X TRUE und FALSE auf anderen Plattformen.","Ein expliziter Startpfad zum Starten des Terminals, dies dient als das aktuelle Arbeitsverzeichnis (CWD) für den Shellprozess. Dies ist insbesondere in Arbeitsbereichseinstellungen praktisch, wenn das Stammverzeichnis kein passendes CWD ist.","Ob aktive Terminalsitzungen beim Beenden bestätigt werden sollen.","Eine Sammlung von Befehls-IDs, deren Tastenzuordnungen nicht an die Shell gesendet und die stattdessen immer durch Code verarbeitet werden. Dies ermöglicht die Verwendung von Tastenzuordnungen, die normalerweise von der Shell verwendet würden, um das gleiche Verhalten wie bei einem Terminal ohne Fokus zu erzielen, z. B. STRG+P zum Starten von Quick Open.","Objekt mit Umgebungsvariablen, das dem unter OS X vom Terminal zu verwendenden VS Code-Prozess hinzugefügt wird","Objekt mit Umgebungsvariablen, das dem unter Linux vom Terminal zu verwendenden VS Code-Prozess hinzugefügt wird","Objekt mit Umgebungsvariablen, das dem unter Windows vom Terminal zu verwendenden VS Code-Prozess hinzugefügt wird","Terminal","Terminal","Anzeigen"],
